// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.28;

import {IVault} from "./IVault.sol";

interface IEntrypoint {

    /**
     * @notice Thrown when trying to deposit an invalid amount
     */
    error InvalidDepositAmount();

    /**
     * @notice Thrown when trying to withdraw an invalid amount
     */
    error InvalidWithdrawalAmount();

    /**
     * @notice Thrown when trying to swap an invalid amount
     */
    error InvalidSwapAmount();

    /**
     * @notice Thrown when trying to swap with an invalid fee amount
     */
    error InvalidFeeAmount();

    /**
     * @notice Thrown when trying to access a non-existent vault
     */
    error VaultNotFound();

    /**
     * @notice Thrown when trying to register a pool for an asset that is already present in the registry
     */
    error VaultAlreadyRegistered();

    /**
     * @notice Thrown when an address parameter is zero
     */
    error ZeroAddress();

    /**
     * @notice Thrown when fee is already paid for a nullifier
     */
    error FeeAlreadyPaid(uint256 nullifier, uint256 paidAmount);


    /**
     * @notice Initialize the vaults and configuration
     * @param assets The list of assets to initialize vaults for
     */
    function initializeVaults(address[] memory assets) external;

    /**
     * @notice Deposit asset into the vault
     * @param _asset Type of asset to deposit (native or ERC20)
     * @param _amount The amount of asset to deposit
     * @param _precommitment The precommitment for the deposit
     * @return _commitment The commitment for the deposit
     */
    function deposit(
        address _asset,
        uint256 _amount,
        uint256 _precommitment
    ) external payable returns (uint256 _commitment);

    /**
     * @notice Withdraw asset from the vault
     * @param _asset The type of asset to withdraw (native or ERC20)
     * @param _recipient The recipient address
     * @param _amount The amount being withdrawn
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function withdraw(
        address _asset,
        address _recipient,
        uint256 _amount,
        uint256 _stateRoot,
        uint256 _nullifier,
        uint256 _newCommitment,
        uint256[24] calldata _proof
    ) external;

    /**
     * @notice Swap asset via the swap router
     * @param _srcToken The source token to send (ERC20 or native).
     * @param _dstToken The output token of the swap (ERC20 or native).
     * @param _recipient The address that receives the swapped output
     * @param _amountIn The input amount to be withdrawn and swapped
     * @param _minAmountOut The minimum acceptable return amount to protect against slippage or MEV
     * @param _fee The pool's fee tier in hundredths of a bip (1e-6)
     * @param _zkProof A struct containing the ZK proof and its public inputs
     */
    function swap(
        address _pool,
        address _srcToken,
        address _dstToken,
        address payable _recipient,
        uint256 _amountIn,
        uint256 _minAmountOut,
        uint24 _fee,
        IVault.ZKProof calldata _zkProof
    ) external;

    /**
     * @notice External function to verify ZK proof
     * @param _asset The type of asset to verify (native or ERC20)
     * @param _amount The amount being withdrawn
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function verify(
        address _asset,
        uint256 _amount,
        uint256 _stateRoot,
        uint256 _nullifier,
        uint256 _newCommitment,
        uint256[24] calldata _proof
    ) external view returns (bool);

    /**
     * @notice Returns the address of vault linked to a specific asset.
     * @param asset The address of the asset to query.
     * @return The vault contract address
     */
    function getVault(address asset) external view returns (address);

    /**
     * @notice Pay execution fee and update commitment (for strategy execution)
     * @param _asset The asset type (native or ERC20)
     * @param _executionPrice The execution price to deduct as fee
     * @param _amount The amount being processed (for proof verification)
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash (with fee deducted)
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function payExecutionFee(
        address _asset,
        uint256 _executionPrice,
        uint256 _amount,
        uint256 _stateRoot,
        uint256 _nullifier,
        uint256 _newCommitment,
        uint256[24] calldata _proof
    ) external;
}

src/interfaces/IMerkleTree.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.28;


interface IMerkleTree {

    /*--------------------------------------------------------------------------------------------
                                                EVENTS
    --------------------------------------------------------------------------------------------*/

    /**
   * @notice Emitted when a new leaf (commitment) is added to the Merkle tree
   * @param _index The index of the leaf
   * @param _leaf The leaf value = hash(commitment, nonce)
   * @param _root The updated root value
   */
    event LeafInserted(uint256 _index, uint256 _leaf, uint256 _root);

    /**
     * @notice Thrown when the tree depth has reached its capacity.
     */
    error MaxDepthReached();

    /*--------------------------------------------------------------------------------------------
                                                VIEWS
    --------------------------------------------------------------------------------------------*/

    /**
     * @notice Returns the current root of the Merkle tree
     * @return _root The current root value
     */
    function getRoot() external view returns (uint256 _root);

    /**
     * @notice Returns the current depth of the Merkle tree
     * @return _depth The current depth value
     */
    function getDepth() external view returns (uint256 _depth);

    /**
     * @notice Returns the current size of the Merkle tree
     * @return _size The current size value
     */
    function getSize() external view returns (uint256 _size);

    /*--------------------------------------------------------------------------------------------
                                                METHODS
    --------------------------------------------------------------------------------------------*/

    /**
     * @notice Insert a leaf to the tree
     * @param _leaf The commitment being added to the tree
     * @return _newRoot New root after leaf has been addded to the tree
     */
    function insert(uint256 _leaf) external returns (uint256 _newRoot);

    /**
     * @notice Checks if the given leaf exists in the tree
     * @param _leaf The commitment to check its existance
     * @return True if leaf exists in the tree. False otherwise
     */
    function has(uint256 _leaf) external view returns (bool);

    /**
     * @notice Checks if the given root was recorded
     * @dev Tree only stores up to most recent ROOT_HISTORY_SIZE number of roots
     * @param _root The root to check
     * @return True if root exists in the root history. False otherwise
     */
    function rootExists(uint256 _root) external view returns (bool);

}

src/interfaces/IVault.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.28;

interface IVault {
    struct SwapParam {
        /// @notice The address of the Uniswap V3 pool to use for the swap
        address pool;
        /// @notice The source token to send (ERC20 or native)
        address srcToken;
        /// @notice The destination token to receive after the swap (ERC20 or native)
        address dstToken;
        /// @notice The address that receives the swapped output
        address payable recipient;
        /// @notice The input amount to be withdrawn and swapped
        uint256 amountIn;
        /// @notice The minimum acceptable return amount to protect against slippage or MEV
        uint256 minAmountOut;
        /// @notice The pool's fee tier in hundredths of a bip (1e-6)
        uint24 fee;
    }

    /*--------------------------------------------------------------------------------------------
                                                ERRORS
    --------------------------------------------------------------------------------------------*/

    /// @notice Emitted when a deposit amount is invalid (e.g., zero)
    error InvalidDepositAmount();

    /// @notice Emitted when a zero-knowledge proof verification fails
    error InvalidZKProof();

    /// @notice Emitted when a nullifier has already been spent
    error NullifierAlreadySpent();

    /// @notice Thrown when trying to withdraw an invalid amount
    error InvalidWithdrawalAmount();

    /// @notice Thrown when the amount received doesn't match msg.value
    error AmountMismatch();

    /// @notice Thrown when native asset transfer fails
    error NativeTransferFailed();

    /// @notice Thrown when vault receives native asset for alternative asset deposit
    error NativeFundReceived();

    /*--------------------------------------------------------------------------------------------
                                                EVENTS
    --------------------------------------------------------------------------------------------*/

    /**
     * @notice Emitted when processing a deposit
     * @param depositor The address of the depositor
     * @param amount The deposited amount
     * @param commitment The commitment hash
     * @param precommitment The deposit precommitment hash
     */
    event Deposited(address indexed depositor, uint256 amount, uint256 commitment, uint256 precommitment);

    /**
     * @notice Emitted when processing a withdrawal
     * @param recipient The address which processed the withdrawal
     * @param amount The withdrawn amount
     * @param nullifier The spent nullifier
     * @param newCommitment The new commitment hash
     */
    event Withdrawn(address indexed recipient, uint256 amount, uint256 nullifier, uint256 newCommitment);

    /**
     * @notice Emitted when vault approves a withdrawal for swap execution
     * @param recipient The address which will receive the swapped output
     * @param _param The swap parameters
     * @param _spentNullifier The spent nullifier
     * @param _newCommitment The new commitment hash
     */
    event Swapped(address indexed recipient, SwapParam _param, uint256 _spentNullifier, uint256 _newCommitment);

    /**
     * @notice Emitted when commitment is updated (e.g., for fee payment)
     * @param amount The amount processed
     * @param nullifier The spent nullifier
     * @param newCommitment The new commitment hash
     */
    event CommitmentUpdated(uint256 amount, uint256 nullifier, uint256 newCommitment);

    /*--------------------------------------------------------------------------------------------
                                                VIEWS
    --------------------------------------------------------------------------------------------*/

    /**
     * @notice Returns the asset being stored in this vault
     * @return _asset The asset address
     */
    function getAsset() external view returns (address _asset);

    /*--------------------------------------------------------------------------------------------
                                                METHODS
    --------------------------------------------------------------------------------------------*/

    /**
   * @notice Deposit funds into the Vault
   * @param _amount The amount being deposited
   * @param _precommitment The precommitment hash
   * @return _commitment The commitment hash
   */
   function deposit(uint256 _amount, uint256 _precommitment) external payable returns (uint256 _commitment);

    /**
     * @notice Withdraw funds from the Vault
     * @param _recipient The recipient address
     * @param _amount The amount being withdrawn
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function withdraw(
        address _recipient,
        uint256 _amount,
        uint256 _stateRoot,
        uint256 _nullifier,
        uint256 _newCommitment,
        uint256[24] calldata _proof
    ) external;    

    /**
     * @notice Approve and send funds from vault to swap executor
     * @param _param The swap parameters
     * @param _swapRouter The swap router address
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    struct ZKProof {
        uint256 stateRoot;
        uint256 nullifier;
        uint256 newCommitment;
        uint256[24] proof;
    }

    /**
     * @notice Approve and send funds from vault to swap executor
     * @param _param The swap parameters
     * @param _swapRouter The swap router address
     * @param _zkProof The ZK proof and its public inputs
     */
    function swap(SwapParam memory _param, address _swapRouter, ZKProof calldata _zkProof) external;

    /**
     * @notice Update commitment with fee deduction (for strategy execution payment)
     * @param _amount The amount being processed (for proof verification)
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash (with fee deducted)
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function updateCommitment(uint256 _amount, uint256 _stateRoot, uint256 _nullifier, uint256 _newCommitment, uint256[24] calldata _proof) external;

    /**
     * @notice Verifies the given ZK proof
     * @param _amount The amount being withdrawn
     * @param _stateRoot The merkle tree root the proof was generated with
     * @param _nullifier The nullifier hash
     * @param _newCommitment The new commitment hash
     * @param _proof The Zero-Knowledge Proof of ownership
     */
    function verify(uint256 _amount, uint256 _stateRoot, uint256 _nullifier, uint256 _newCommitment, uint256[24] calldata _proof) external view returns (bool);
}

